_jss.fn.accordion = function (entity, config) {
    var _this = this;

    // 构造panel
    var group = document.createElement('div');
    _this.append(entity, group);
    var items = config.items || [];
    var hmm = new HmAccordionMethod(group,_this,config);
    hmm.initAccordCss();
    hmm.createAccordion(items);
    // 动态设置样式
    _this.css(group, {
        'width': config.width || 'auto',
        'height': config.height || 'auto'
    });
    // 将伸缩面板添加到指定窗口中

    return hmm;
};

function HmAccordionMethod(group,fn,config) {
 var _t = this;
 this.group = group;
    // 缓存panel数据
 this.itemlist = {};
 this.fn = fn;
 this.config = config;
 this.group.className = "jss-accordion-group";
}

HmAccordionMethod.prototype = {
    /*
     * 打开所有面板
     */
    openAll: function () {
        this.addActive(this.group);
    },
    /*
     * 关闭所有面板
     */
    closedAll: function () {
        this.distoryActive(this.group);
    },
    /*
     * 打开指定面板
     */
    open: function (id) {
        this.itemlist[id].click();
    },
    /*
     * 更新面板面容
     */
    updateData: function (items) {
        this.group.innerHTML = "";
        this.createAccordion(items);
    },
    // 添加所有子节点激活状态
    addActive: function (dom) {
        var chlids = this.fn.children(dom);
        for (var i = 0; i < chlids.length; i++) {
            var child = chlids[i];
            if (!this.fn.hasClass(child, 'jss-acc-p-active')) {
                this.fn.addClass(child, 'jss-acc-p-active');
            }

        }
    },
    // 销毁所有子节点激活状态
    distoryActive: function (dom) {
        var chlids = this.fn.children(dom);
        for (var i = 0; i < chlids.length; i++) {
            var child = chlids[i];
            if (this.fn.hasClass(child, 'jss-acc-p-active')) {
                this.fn.removeClass(child, 'jss-acc-p-active');
            }

        }
    },
    bulidAccordion2: function (item, i) {
        var _t = this;
        var pClasName = "";
        // 样式
        if ((!i && this.config.firstOpen) || (!i && typeof this.config.firstOpen == "undefined") || this.config.openAll) {
            pClasName = "jss-accordion-panel " + (item.stopClick ? '' : 'jss-acc-p-active');
        } else {
            // 如果设置加载打开
            pClasName = "jss-accordion-panel " + (item.active ? 'jss-acc-p-active' : '');
        }
        var str = '<div class="'+pClasName+'">' +
             '<div flag="'+(i)+'" class="jss-accordion-panel-header"><a class="jss-accordion-panel-header-h4-a">'+(item.title || '')+'</a></div>' +
             '<div class="jss-accordion-panel-collapse"><div class="jss-accordion-panel-collapse-body">'+(item.content || '')+'</div></div>' +
         '</div>';

        return str;
    },
    // 创建伸缩列表
    createAccordion: function (items) {
        var _t = this;
        _t.items = items;
        var panhtml ="";
        for (var i = 0; i < items.length; i++) {
            var item = items[i];
            panhtml = panhtml +this.bulidAccordion2(item, i);
        }
        _t.group.innerHTML = panhtml;
        var headers = _t.fn.getElementsByClass('jss-accordion-panel-header',_t.group);
        _t.fn.bind(headers,'onclick',function(event){
            var isForStopClick = _t.config.configStopClick && _t.config.configStopClick(event);
            _t.headerClick(this,isForStopClick);
        });
    },
    headerClick:function(obj,isForStopClick){
        var _t = this;
        var item =_t.items[obj.getAttribute('flag')];

        if(item.stopClick||isForStopClick){
            return;
        }else{
            if (_t.config.mutex) {
                _t.distoryActive(_t.group);
            }
            var heard = _t.fn.parent(obj);
            _t.fn.toggleClass(heard, 'jss-acc-p-active');
            var body = _t.fn.getElementsByClass('jss-accordion-panel-collapse-body',heard)[0];
            // 回调
            item.callback && item.callback.call(obj, body, _t.fn.hasClass(heard, 'jss-acc-p-active'));
        }
    },
    //初始化伸缩列表样式
    initAccordCss:function(){
        if(window['_style_sheet_stores'] && window['_style_sheet_stores']['accordion-group'] && window['_style_sheet_stores']['accordion-panel']){
            return;
        }
        // 存放面板盒子
        var groupcss = {
            width: "auto",
            height: "auto"
        };
        this.fn.addStyleSheet("accordion-group", {
            key: ".jss-accordion-group",
            value: groupcss
        });


        // 面板
        var panelcss = {
            'padding-bottom': '5px',
            'position': 'relative',
            'border-radius': '5px',
            'background': '#ffffff',
            'display': 'block'
        };
        this.fn.addStyleSheet("accordion-panel", {
            key: ".jss-accordion-panel",
            value: panelcss
        });

        // 激活面板
        var panelactivecss = {
            display: 'block'
        };
        this.fn.addStyleSheet("accordion-panel-active", {
            key: ".jss-acc-p-active .jss-accordion-panel-collapse",
            value: panelactivecss
        });

        // 头部
        var headercss = {
            'color': '#444',
            'display': 'block',
            'background': '#eff3f4',
            'line-height': '25px',
            'padding': '8px 0',
            'border-radius': '5px',
            'position': 'relative',
            'width': '100%',
            'zoom': 1

        };
        this.fn.addStyleSheet("accordion-panel-header", {
            key: ".jss-accordion-panel-header",
            value: headercss
        });

        var acss = {
            'font-size': '16px',
            'display': 'block',
            'margin': 0,
            'color': '#666666',
            'text-decoration': 'none',
            'display': 'block',
            'padding-left': '15px',
            'cursor': 'pointer',
            'background-color': 'transparent'
        };
        var ahovercss = {
            'color': '#666666'
        };
        this.fn.addStyleSheet("accordion-panel-header-h4-a", {
            key: ".jss-accordion-panel-header-h4-a",
            value: acss
        });
        this.fn.addStyleSheet("accordion-panel-header-h4-ahover", {
            key: ".jss-accordion-panel-header-h4-a:hover",
            value: ahovercss
        });

        // 内容
        var collapsecss = {
            'display': 'none',
            'border-top': '1px solid #dde6e6',
            'zoom': 1,
            'width': '100%'
        };
        this.fn.addStyleSheet("accordion-panel-collapse", {
            key: ".jss-accordion-panel-collapse",
            value: collapsecss
        });

        var bodycss = {
            'border-top-left-radius': '0',
            'border-top-right-radius': '0',
            'border-bottom-right-radius': '3px',
            'border-bottom-left-radius': '3px'
        };
        this.fn.addStyleSheet("accordion-panel-collapse-body", {
            key: ".jss-accordion-panel-collapse-body",
            value: bodycss
        });
    }

};
_jss.fn.addClass = function(arr, newclass){
	if(!this.isCollection(arr)){
	    arr = [arr];
	}
	for(var i = 0; i<arr.length; i++){
	    var entity = arr[i];
	    var boo = this.hasClass(entity, newclass);
	    if(!boo){
	        entity.className +=" "+newclass;
	    }
	}

}
_jss.fn.addStyleSheet = function(cssId, cssText){
    // 标记设置过的样式 【注】每个cssId对应的样式表只能设置一次
    if(!window['_style_sheet_stores']){
        window['_style_sheet_stores'] = {};
    }
    if(window['_style_sheet_stores'][cssId]){
        // 设置过的不再进行设置
        return ;
    }
    window['_style_sheet_stores'][cssId] = true;
	// 兼容对象设置样式
	if(typeof cssText === 'object'){
		cssText = this.toCssText(cssText['key'], cssText['value']);
	}
	var _this = this;
	var head  = document.getElementsByTagName('head').item(0);
	var	style =	head.getElementsByTagName("style");

	// 在 head 中创建 style 标签来存放样式表
	if(!style || style && !style.length){
		if(document.createStyleSheet){
            document.createStyleSheet(); // ie 在head中生成一个style标签
        }else{
            var st = document.createElement('style'); //w3c
	            st.setAttribute("type", "text/css");
	            head.appendChild(st);
        }
	};

	// 添加样式表
	var ss = head.getElementsByTagName("style").item(0);
	if(ss.styleSheet){    //ie
        ss.styleSheet.cssText += cssText;
    }else if(document.getBoxObjectFor){
        ss.innerHTML += cssText; //火狐支持直接innerHTML添加样式表字串
    }else{
        ss.appendChild(document.createTextNode(cssText));
    }
	
}
/*
 * 将css样式json对象转成样式字符串
 * @param className 类名 如： body .list
 * @param cssJson 样式json对象
 * return 样式表 如： body{width:100px;}
 */
_jss.fn.toCssText = function(className, cssJson){
	var r = className+"{";
	for(var key in cssJson){
		r += key+":"+cssJson[key]+";";
	}
	r+="}";
	return r;
}
_jss.fn.ajax = function(opt){
	var xmlhttp;
	//1.
	if (window.XMLHttpRequest) {
	    try {
	        xmlhttp = new XMLHttpRequest();
	        if( xmlhttp.overrideMimeType ){
			    xmlhttp.overrideMimeType("text/html; charset=UTF-8");
			}
	    } catch(e) {}
	} else if (window.ActiveXObject) {
	    try {
	        xmlhttp = new ActiveXObject("Microsoft.XMLHTTP");
	    } catch(e) {
	        try {
	            xmlhttp = new ActiveXObject("Msxml2.XMLHttp");
	        } catch(e) {
	            try {
	                xmlhttp = new ActiveXObject("Msxml3.XMLHttp");
	            } catch(e) {}
	        }
	    }
	}
	//2.
	xmlhttp.onreadystatechange = function() {
	    if (xmlhttp.readyState == 4) { //readystate 为4即数据传输结束
	    	var r = "";
	        try {
	            if (xmlhttp.status == 200) {
	            	var result = xmlhttp.responseText;
	            	try{
	            		//默认返回值为JSON数据
	            		result = JSON.parse(result);
	            	}catch(e){
	            		// e todo
	            	}
	                opt.success && opt.success.call(this, result);
	            } else {
	                opt.error && opt.error.call(this, xmlhttp);
	            }
	        } catch(e) {
	            opt.error && opt.error.call(this, e);
	        }
	    }
	}
	
	//构造请求参数
	var param = "";
	if(opt.data){
		for(var key in opt.data){
			param += (key + "=" + opt.data[key] + "&");
		}
		param = param.substring(0, param.length-1);
	}
	//构造GET请求
	var metch = opt.type || 'GET';
	var sendParam = null;
	if(metch === "GET" && param){
		opt.url += ('?' + param);
	}else{
		//POST 请求参数
		sendParam = JSON.stringify(opt.data);
	}
	//3.
	var isAsync = true;  //缺省为异步请求
	if(opt.async === false || opt.async === "false"){
		isAsync = false;
	}
	xmlhttp.open(metch, opt.url, isAsync);
	if(metch === "POST"){
		// xmlhttp.setRequestHeader("Content-Type","application/x-www-form-urlencoded");
		xmlhttp.setRequestHeader("Content-Type","application/json;charset=UTF-8");
	}
	//设置请求头
	if(opt.header){
		for(var key in opt.header){
			xmlhttp.setRequestHeader(key, opt.header[key]);
		}
	}
	xmlhttp.send(sendParam); 

}
_jss.fn.append = function(result, obj){
	if(typeof obj == 'string'){
		obj = document.createTextNode(obj);
	}
	if(!this.isCollection(obj)){
        obj = [obj];
    }
    for(var i = 0; i<obj.length; i++){
    	result.appendChild(obj[i]);
    }
	return obj;
}
_jss.fn.setAttr = function(result, params){
	//设置
	if(params && !this.isCollection(result)){
        result = [result];
    }
    for(var i = 0; i<result.length; i++){
        var o = result[i];
        add(o);
    }
    function add(o){
        for(var key in params){
            if(key == "style"){
                o.style.cssText = params[key];
            }else if(key == "class"){
                o.className = params[key];
            }else{
                o.setAttribute(key, params[key]);
            }
        }
    }
}
/*
 * 获取元素属性
 * @param result dom对象
 * @param attrName 属性名
 */
_jss.fn.getAttr = function(result, attrName){
    //获取
    if(attrName == "class"){
        return result.className;
    }else if(attrName == "style"){
        return result.style.cssText;
    }else{
        return result.getAttribute(attrName);
    }
}
