/*
 * 安装事件
 */
_jss.fn.fixEvent = function(e){
    if(!window.event&&!e){
        var r,eventExec = "arguments.callee.caller";
        while(!r){
            eventExec += ".caller";
            r = eval(eventExec+".arguments[0]");
            r && (r.toString() != '[object MouseEvent]') && (r = null);
        }
        return r;
    }
    return (window.event || e);
}
/*
 * 事件绑定
 * @param arr 可以绑定一个dom 对象数组
 * @param type 事件类型如：onclick,onchange,onkeydown等
 * @param callback 回调方法
 */
_jss.fn.bind = function(arr, type, callback) {
    var _this = this;
    if(!arr)return ;
    if(!this.isCollection(arr)){
        arr = [arr];
    }
    for(var i = 0; i<arr.length; i++){
        var o = arr[i];
        if(typeof o != "object")continue;
        // o['_'+type] = callback;//缓存绑定的事件，方便日后解绑,因为解绑的事件必须与绑定的事件一至
        function fn(o){
            return function(e){
                callback && callback.call(o, e);
            }
        }
        o['_'+type] = fn(o);
        addEv(o);
    }
    function addEv(o){
        var fn = o['_'+type];
        if (o.attachEvent) {
            // IE6+
            o.attachEvent(type, fn, false);
        } else if (o.addEventListener) {
            // chrome,firefox
            o.addEventListener(type.substring(2), fn, false);
        } else {
            o[type] = fn;
        }
    }
}

/*
 * 事件解绑
 * @param arr
 * @param type 事件类型如：onclick,onchange,onkeydown等
 * [注]解绑时，o和callback函数必须与绑定时的相同
 */
_jss.fn.unbind = function(arr, type) {
    if(!arr)return ;
    if(!this.isCollection(arr)){
        arr = [arr];
    }
    for(var i = 0; i<arr.length; i++){
        var o = arr[i];
        if(typeof o != "object")continue;
        removeEv(o, o['_'+type]);
    }
    function removeEv(o, callback){
        if (o.detachEvent) {
            o.detachEvent(type, callback||function(){});
        } else if (o.removeEventListener) {
            o.removeEventListener(type.substring(2), callback||function(){}, false);
        } else {
            o[type] = null;
        }
    }
}




_jss.fn.getElementsByClass = function(clazzName, entity){
	var cNames,
		cName,
		r = [],
		elems = entity ? entity.getElementsByTagName("*") : (document.all || document.getElementsByTagName("*"));
	for(var i = 0; i<elems.length; i++){
		cName = elems[i].className;//获取当前对象的类名
		if(cName){
			cNames = cName.split(" ");//类名存在，则进行拆分
			for(var j = 0; j<cNames.length; j++){
				if(cNames[j] && cNames[j] == clazzName){
					r.push(elems[i]);//类名存在且与指定的名相同，则存储对象
				}
			}
		}
	}
	elems=cNames=cName=null;
	return r;	
}
_jss.fn.getElementById = function(id, entity){
	var r = null, elems = null;
	if(entity){
		elems = entity.getElementsByTagName('*');
		for(var i = 0; i < elems.length; i++){
			var item = elems[i];
			if(item.id == id){
				return item;
			}
		}
	}else{
		r = document.getElementById(id);
	}	
	return r;	
}
_jss.fn.getElementsByAttr = function(input_str, domDiv){
    input_str = input_str.replace(/\s/g,"");
    var typeReg = /(\w+)\[(\S+)\]/;
    var eleTag,attrs=[];
    var arr = input_str.match(typeReg);
    if(arr){
        eleTag = arr[1];
        attrs = arr[2].split('][');
    }else{
        eleTag = input_str;
    }
    var domList = this.getElementsByTagName(eleTag,domDiv);
   // this.get(eleTag, domDiv);

    var checkedList = [];
    if(attrs.length){
        for(var i = 0;i<domList.length;i++){
            var temp = domList[i];
            var hasMatch = true;
            for(var j=0;j<attrs.length;j++){
                var attTemp = attrs[j].split("=");
                if(attTemp.length>1){
                    if(!(temp.getAttribute(attTemp[0])==attTemp[1])){
                        hasMatch = false;
                        break;
                    }
                }else{
                    if(temp.getAttribute(attTemp[0])==null){
                        hasMatch = false;
                        break;
                    }
                }
            }
            if(hasMatch){
                checkedList.push(temp);
            }
        }
        return checkedList;
    }else{
        return domList;
    }
}
_jss.fn.getElementsByTagName = function(tagName, entity){
	var r = [], elems = null;
	if(entity){
		elems = entity.getElementsByTagName('*');
		for(var i = 0; i < elems.length; i++){
			var item = elems[i];
			if(item.tagName == tagName.toLocaleUpperCase()){
				r.push(item);
			}
		}
	}else{
		r = document.getElementsByTagName(tagName);	
	}	
	return r;	
}

_jss.fn.hasClass = function(result, className){

	return new RegExp('(\\s|^)'+className+'(\\s|$)').test(result.className);
}
_jss.fn.hide = function(entity,speed,cbk){
	var _t = this;
	var time = speed/10;
	if(speed){
		var num = 10;
		if(entity.outIntervalId){
			clearInterval(entity.outIntervalId);
		}
		entity.outIntervalId = setInterval(function(){
			num--;
			_t.css(entity, {display: 'block',opacity:num/10,filter: 'alpha(opacity='+(num*10)+')'});
			if(num<=0){
				_t.css(entity, {display: 'none',filter:'none'});
				clearInterval(entity.outIntervalId);
				entity.outIntervalId=null;
				cbk && cbk();
			}
		},time)
	}else{
		this.css(entity, {display: 'none'});
	}
};
_jss.fn.html = function(arr, text){
	if(!this.isCollection(arr)){
	    arr = [arr];
	}
	// 获取
	if(typeof text == 'undefined'){
		var entity = arr[0];
		return entity.innerHTML;
	}
	text =text+'';
	if(text.indexOf('<style>')!=-1 || text.indexOf('</style>')!=-1){
		// 设置
		for(var i = 0; i<arr.length; i++){
			var temp = this.createElementByTagName('div');
			temp.innerHTML = "x<div>"+text+"</div>";
			var entity = arr[i];
			entity.appendChild(temp.lastChild);
		}
	}else{
		// 设置
		for(var i = 0; i<arr.length; i++){
			var entity = arr[i];
			entity.innerHTML = text || "";
		}
	}

}
_jss.fn.inputTimer = function (input, onFocusCallback, onBlurCallback, time){
    //var input = document.getElementById('search_input');
    input.onfocus=function(){
		var isInput = input.type=="textarea" || input.type=="text";
		var inputPrevValue = isInput?input.value:input.innerHTML;
    	//开启timer 时时监控值的改变
        input._searchInputTimer = setInterval(function(){
            var currentValue = isInput?input.value:input.innerHTML;
            if(inputPrevValue != currentValue){
                inputPrevValue =  currentValue;
                onFocusCallback && onFocusCallback.call(input);
            }
        },time || 100);
    }
    input.onblur=function(){
    	//清除timer的监控
        if(input._searchInputTimer){
            clearInterval(input._searchInputTimer);
            input._searchInputTimer = null;
            onBlurCallback && onBlurCallback.call(input);
        }
    }
}
_jss.fn.isCollection = function(entity){

	return this.isArray(entity) || this.isHTMLCollection(entity);
}
/*
 * 判断是否为数组
 */
_jss.fn.isArray = function(entity){
    return Object.prototype.toString.call(entity) === "[object Array]";
},
/*
 * 判断是否为数组
 */
_jss.fn.isHTMLCollection = function(entity){
    return Object.prototype.toString.call(entity) === "[object HTMLCollection]" ||
           Object.prototype.toString.call(entity) === "[object NodeList]";
}
_jss.fn.isee = function(target, obj, isFind){
		//find();参数为空时，则查找所有
		if(isFind && !target && obj.result){
			obj.result = obj.result.getElementsByTagName('*');
			return obj;
		}
    	/*
		 * 参数为dom对象
    	 */
    	if(typeof target === 'object' && !target.isJss){
    		obj.result = target;
    		return obj;
    	}

    	// 备用名，过滤掉【# . 】等前缀
    	var xname = target ? target.substring(1) : '';

		/**
		 * 通过ID获取元素
		 * @param name 为元素 #id
		 */
		if(/^#[^\s]+$/.test(target)){

			obj.result = this.getElementById(xname, isFind ? obj.result : null);
			return obj;
		}

		/**
		 * 通过CLASS获取元素
		 * @param name 为元素 .className
		 */
		if(/^\.[^\s]+$/.test(target)){
			obj.result = isOneDom(this.getElementsByClass(xname, isFind ? obj.result : null));
			return obj;
		}

		/**
		 * 通过标签名获取元素
		 * @param name 为元素的标签名称如：div
		 */
		if(/^[a-zA-Z0-9]+$/.test(target)){
			obj.result = isOneDom(this.getElementsByTagName(target, isFind ? obj.result : null));
			return obj;
		}

		//属性div[xx=xxx]
		if(/^[a-zA-Z0-9]+\[+[^\s]+\]+$/.test(target)){
			var dom = /^[a-zA-z0-9][^\[]+/.exec(target).toString();		// 获取参数中的标签名，如div
			obj.result = isOneDom(this.getElementsByAttr(target,obj.result));
			return obj;
		}

		// 属性[xx=xxx]
		if(/^\[+[^\s]+\]+$/.test(target)){
			obj.result = isOneDom(this.getElementsByAttr(target, document.body));
			return obj;
		}
		
		/**
		 * 根据dom标签字符串创建dom元素
		 * @param name 为html标签名如：'<div>'
		 */
		if(/^\<[^\>\<]+\>$/.test(target)){
			var tagName = target.replace(/^\<+|\>+$/g,"").toLocaleLowerCase();
			obj.result = this.createElementByTagName(tagName);
			return obj;
		}	
		
		//数组里只有一个元素时，则只取这一个对象
	    function isOneDom(o){
	    	if(o && o.length == 1){
	    		return o[0];
	    	}else{
	    		return o;
	    	}
	    }

}
_jss.fn.loading = function(entity, config) {
	var _this = this;
	var imgs = _this.getElementsByClass("jss-loading-img",entity);
	if(imgs && imgs.length){   //只允许一个loading
		_this.remove(imgs);
	}
	var img = document.createElement('img'),
		di = {},
		likeImg=document.createElement('div');


	img.className = 'jss-loading-img';

	// 计算中心位置，方便设置loading在指定容器距中显示 
	var width = entity.clientWidth || entity.offsetWidth; //loading 父容器宽度
	var loadingCenter = (parseFloat(width) - 35) / 2 + 'px'; //设置loading距中位置
	// loading图标样式
	var imgcss = {
			position: config.position || 'absolute',
			zIndex: config.zIndex || '99999999',
			margin: '0 auto',
			display: 'block',
			width: config.width || 'auto',
			left: config.left || loadingCenter,
			top: config.top || '100px',
			fontSize:'12px',
			color:'#666'
		};
	var likeImgcss = {
			position: config.position || 'absolute',
			zIndex: config.zIndex || '99999999',
			margin: '0 auto',
			width: config.width || 'auto',
			left: config.left || loadingCenter,
			top: config.top || '100px',
			fontSize:'10px',
			color:'#666'
		};
		// 设置
	likeImg.innerHTML='加载中...';
	this.css(img, imgcss);
	this.css(likeImg, likeImgcss);
	img.src = config.src || "data:image/gif;base64,";
	if((!config.src)&&(/MSIE\s6.0/g.test(navigator.userAgent)||/MSIE\s7.0/g.test(navigator.userAgent))){
		this.append(entity, likeImg);
	}else{
		this.append(entity, img);
	}
	// 删除loading
	di.remove = function() {
		try {
			_this.remove(img);
		} catch (e) {}
        try {
            _this.remove(likeImg);
        } catch (e) {}

	}

	return di;
}
_jss.fn.panel = function(entity, config){
	var _this = this,
		box = document.createElement('div'),
		head = document.createElement('div'),
		body = document.createElement('div');

	//样式类
	box.className = "jss-panel-box";
	head.className = "jss-panel-head";
	body.className = "jss-panel-body";

	// 样式
	var boxcss = {
		'position': 'relative',
	    'border-radius': '3px',
	    'background': '#ffffff',
	    'border': '1px solid #dde6d6',
		'border-radius':'5px',
	    'margin-bottom': '10px',
	    'height': 'auto'
	};

	var headcss = {
		'border-bottom': '1px solid #dde6d6',
		'color': '#444',
	    'display': 'block',
	    'padding-left': '15px',
	    'height': '45px',
	    'line-height': '45px',
	    'position': 'relative',
	    'font-size': '16px',
	    'font-weight': 'bold',
	    'margin': '0',
		'background':'#F5F9F8',
		'border-radius':'5px 5px 0 0'
	};

	var bodycss = {
	    'border-top-left-radius': '0',
	    'border-top-right-radius': '0',
	    'border-bottom-right-radius': '3px',
	    'border-bottom-left-radius': '3px',
	    'padding': '10px'
	}

	_this.addStyleSheet("panel-box", {
		key: ".jss-panel-box",
		value: boxcss
	});
	_this.addStyleSheet("panel-head", {
		key: ".jss-panel-head",
		value: headcss
	});
	_this.addStyleSheet("panel-body", {
		key: ".jss-panel-body",
		value: bodycss
	});

// 动态设置样式
	_this.css(box, {
		'width': config.width || 'auto',
	    'height': config.height || 'auto'
	});

	// 内容
	head.innerHTML = config.title || '';
	body.innerHTML = config.content || '';

	// 添加
	_this.append(box, head);
	_this.append(box, body);
	_this.append(entity, box);

	// 动态设置内容和标题
	config.callback && config.callback.call(entity, head, body)

}

_jss.fn.parent = function(result){
	var r = null;
	if(result){
		try{
			r = result.parentNode;
			while(!r.tagName) {
				r = r.parentNode;
				if(!r)return;
			}
		}catch(e){}
	}
	
	return r;
}

_jss.fn.queryUrlParam = function(name){
	var reg = new RegExp("(^|&)" + name + "=([^&]*)(&|$)", "i");
    var r = window.location.search.substr(1).match(reg);
    if (r !== null) return decodeURIComponent(r[2]); 
    return null;
}

_jss.fn.randomNum = function (startNum, endNum){

  return (Math.random() * ( endNum - startNum ) + startNum);
}
_jss.fn.remove = function(result){
    if(!result){
        return;
    }
    if(!this.isCollection(result)){
        result = [result];
    }
    for(var i = 0; i<result.length; i++){
        this.parent(result[i]).removeChild(result[i]);
    }
}
_jss.fn.removeClass = function(arr, className){
	if(!this.isCollection(arr)){
	    arr = [arr];
	}
    for(var i = 0; i<arr.length; i++){
        var entity = arr[i];
        var entityClass = entity.className || "";
        if(entityClass && this.hasClass(entity, className)){
            entityClass = entityClass.replace(new RegExp('(\\s|^)'+className+'(\\s|$)')," ");
            entity.className = entityClass.trim();
        }
    }

}
